import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { HttpClientModule } from '@angular/common/http';
import { FormsModule } from '@angular/forms';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';

// ✅ Import your feature modules
import { MetalModule } from './metal/metal.module';
import { PurityModule } from './purity/purity.module';
import { MetalRateModule } from './metal-rate/metal-rate.module';

@NgModule({
  declarations: [
    AppComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule,
    FormsModule,
    MetalModule,        // ✅ now used
    PurityModule,       // ✅ now used
    MetalRateModule     // ✅ now used
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
